		{'identifier': 'mb_fob_event_info_01', 'language': 'jp', 'text': 'BIGBOSS\nMosquitoPF\n\n'}, 
		{'identifier': 'mb_fob_event_info_01', 'language': 'en', 'text': "A former comrade, Mosquito, once plotted to take over Mother Base in his mad pursuit to exact revenge on Big Boss. The stronghold of the PF he commanded has been located. There, remnants of Mosquito's PF are attempting to rebuild the organization. Make sure this does not happen. Infiltrate the enemy platform, and make it to the core."}, 
		{'identifier': 'mb_fob_event_info_01', 'language': 'fr', 'text': "Un ancien camarade surnomm Moustique, a tent de s'emparer de Mother Base dans le but dment de se venger de Big Boss. La forteresse de la SMP qu'il commande a t localise. C'est l-bas que ce qui reste de son organisation tente de se reconstruire. Faites en sorte que cela n'arrive pas. Infiltrez la plateforme ennemie et atteignez son centre."}, 
		{'identifier': 'mb_fob_event_info_01', 'language': 'it', 'text': "Un ex compagno, Mosquito, una volta ha cercato di prendere il controllo della Mother Base nel folle tentativo di vendicarsi di Big Boss. La base della forza privata ai suoi comandi  stata localizzata. I suoi pochi uomini rimasti stanno cercando di ricostruire l'organizzazione. Assicurati che ci non avvenga. Infiltrati nella piattaforma nemica e raggiungi il centro."}, 
		{'identifier': 'mb_fob_event_info_01', 'language': 'de', 'text': 'Mosquito, ein ehemaliger Kamerad, hatte einst den wahnsinnigen Plan, als Rache an Big Boss die Mother Base zu bernehmen. Die Festung des MUs, das er angefhrt hat, wurde gefunden. Dort versuchen nun ehemalige Mitarbeiter seines Unternehmens, die Organisation neu aufzubauen. Sorgen Sie dafr, dass das nicht geschieht! Infiltrieren Sie die feindliche Plattform und dringen Sie bis zu ihrem Kern vor.'}, 
		{'identifier': 'mb_fob_event_info_01', 'language': 'es', 'text': 'Un excamarada, Mosquito, plane la toma de la Base Madre en su loca bsqueda de venganza contra Big Boss. El bastin de las FP que l comandaba ya fue localizado. All, restos de las FP de Mosquito intentan reconstruir la organizacin. Asegrate de que eso no ocurra. Infltrate en la plataforma enemiga y llega hasta el ncleo.'}, 
		{'identifier': 'mb_fob_event_info_01', 'language': 'pt', 'text': 'Um antigo camarada, Mosquito, uma vez conspirou para tomar a Mother Base em uma busca insana por vingana contra o Big Boss. A fortaleza da FP que ele comandou foi localizada. L, remanescentes da FP de Mosquito esto tentando reconstruir a organizao. No deixe isso acontecer. Infiltre-se na plataforma inimiga e v at o ncleo dela.'}, 
