		{'identifier': 'mb_fob_event_info_02', 'language': 'jp', 'text': 'PF\n\nPF\nPFNO ALERTPFKILL COUNT\n'}, 
		{'identifier': 'mb_fob_event_info_02', 'language': 'en', 'text': 'Upstart PFs are appearing all over the globe. Though inspired by Diamond Dogs, their reckless actions, motivated by money, have brought chaos to our areas of operations. Not only have they brought discredit to the PF industry, they are now on the verge of triggering new conflicts. One of these PFs, known as "No Alert," has requested that we infiltrate their rival "Kill Count." Your mission is to infiltrate the base and put Kill Count\'s personnel and materials to better use in Diamond Dogs.'}, 
		{'identifier': 'mb_fob_event_info_02', 'language': 'fr', 'text': 'De nouvelles SMP apparaissent partout dans le monde. D\'abord inspires par les Diamond Dogs, leurs actions intrpides motives seulement par l\'argent ont sem le chaos dans notre secteur d\'activit. Non seulement elles ont jet le discrdit sur l\'industrie des SMP, mais elles sont sur le point de dclencher de nouveaux conflits. Une de ces SMP, du nom de "No Alert", nous a demand d\'inflitrer une de ses rivales, "Kill Count". Votre mission est d\'infiltrer leur base et de faire un meilleur usage de leur personnel et quipement pour les Diamond Dogs.'}, 
		{'identifier': 'mb_fob_event_info_02', 'language': 'it', 'text': 'In tutto il mondo, stanno comparendo nuove forze private. Anche se ispirate ai Diamond Dogs, le loro azioni sconsiderate, motivate solo dalla sete di denaro, hanno portato il caos nelle nostre zone operative. Non solo hanno screditato l\'intero settore delle forze private, ma ora sono anche sul punto di innescare nuovi conflitti. Una di queste forze private, conosciuta come "No Alert" ci ha chiesto d\'infiltrarci nella base dei loro rivali "Kill Count". La tua missione  infiltrarti nella base e fare un miglior uso del personale e dei materiali dei Kill Count nei Diamond Dogs.'}, 
		{'identifier': 'mb_fob_event_info_02', 'language': 'de', 'text': 'Aufstrebende MUs schieen berall auf der Welt wie Pilze aus dem Boden. Obwohl sie von den Diamond Dogs inspiriert wurden, haben sie mit ihren skrupellosen Aktionen, bei denen es nur um Geld geht, unsere Einsatzgebiete ins Chaos gestrzt. Sie haben nicht nur die gesamte MU-Branche in Verruf gebracht, sondern stehen kurz davor, selbst neue Konflikte auszulsen. Eines dieser MUs, "No Alert", hat uns gebeten, seinen Rivalen "Kill Count" zu infiltrieren. Also, infiltrieren Sie Kill Counts Basis, um ihre Leute und Materialien bei den Diamond Dogs besser zu nutzen.'}, 
		{'identifier': 'mb_fob_event_info_02', 'language': 'es', 'text': 'FP arribistas empiezan a aparecer por todo el mundo. Aunque inspiradas en los Diamond Dogs, sus acciones temerarias, motivadas por el dinero, han sembrado el caos en nuestras reas de operaciones. No solo han trado descrdito a la industria de las FP, sino que estn a punto de provocar nuevos conflictos. Una de estas FP, conocida como "No Alert", ha pedido que infiltremos a su rival "Kill Count". Tu misin es infiltrar la base y poner a su personal y materiales al mejor servicio de los Diamond Dogs.'}, 
		{'identifier': 'mb_fob_event_info_02', 'language': 'pt', 'text': 'FPs iniciantes esto aparecendo por todo o mundo. Embora se inspirem nos Diamond Dogs, suas aes imprudentes, motivadas pelo dinheiro, levaram o caos s nossas reas de operaes. Alm de manchar a reputao do setor de FPs, agora esto a ponto de iniciar novos conflitos. Uma dessas FPs, conhecida como "No Alert" (Sem Alerta), solicitou para infiltrarmos em sua rival, a "Kill Count" (Contagem de Mortes). Sua misso  infiltrar na base para depois fazer melhor uso do pessoal e material da Kill Count nos Diamond Dogs.'}, 
		{'identifier': 'mb_fob_event_info_02', 'language': 'ru', 'text': '       ,   Diamond Dogs.             .       ,      .   " "          ,    "".          Diamond Dogs.'}, 
