		{'identifier': 'mb_fob_event_info_03', 'language': 'jp', 'text': 'PFNO ALERTPFKILL COUNT\nNO ALERT\nKILL COUNT\n'}, 
		{'identifier': 'mb_fob_event_info_03', 'language': 'en', 'text': 'We\'ve received a new contract from small-time PF "NO ALERT." They claim that the hardline PF "KILL COUNT" has been repeatedly abducting and interrogating NO ALERT personnel.\nThe mission objective is to infiltrate a KILL COUNT platform, extract as many prisoners as possible and reach the goal point.'}, 
		{'identifier': 'mb_fob_event_info_03', 'language': 'fr', 'text': "On a reu un nouveau contrat de la petite SMP  NO ALERT . Ils disent que les durs de la SMP  KILL COUNT  enlvent rgulirement des membres de NO ALERT pour les interroger.\nL'objectif de la mission est d'infiltrer une plateforme KILL COUNT, d'extraire autant de prisonniers que possible, et d'atteindre le point fix."}, 
		{'identifier': 'mb_fob_event_info_03', 'language': 'it', 'text': 'Abbiamo ricevuto un nuovo contratto dalla piccola FP "NO ALERT". Sostengono che la coriacea FP "KILL COUNT" abbia pi volte rapito e interrogato alcuni membri della NO ALERT.\nL\'obiettivo della missione  infiltrarsi in una piattaforma della KILL COUNT, recuperare il maggior numero di prigionieri possibile e raggiungere il punto stabilito.'}, 
		{'identifier': 'mb_fob_event_info_03', 'language': 'de', 'text': 'Wir haben einen neuen Auftrag von einem kleinen MU namens NO ALERT erhalten. Sie behaupten, dass das aggressiv vorgehende MU KILL COUNT wiederholt Mitarbeiter von NO ALERT entfhrt und verhrt hat.\nUnsere Mission: eine KILL COUNT-Plattform infiltrieren, so viele Gefangene wie mglich rausholen und den Zielpunkt erreichen.'}, 
		{'identifier': 'mb_fob_event_info_03', 'language': 'es', 'text': 'Hemos recibido un nuevo contrato de la pequea FP "NO ALERT". Ellos afirman que la lnea dura de la FP "KILL COUNT" ha estado secuestrando e interrogando al personal NO ALERT.\nEl objetivo de la misin es infiltrar la plataforma de KILL COUNT, extraer a tantos prisioneros como sea posible y alcanzar el punto meta.'}, 
		{'identifier': 'mb_fob_event_info_03', 'language': 'pt', 'text': 'Recebemos um novo contrato de uma FP pequena, a "NO ALERT" (Sem Alerta). Eles dizem que a FP linha-dura "KILL COUNT" (Contagem de Mortes) tem sequestrado e interrogado o pessoal da NO ALERT.\nO objetivo da misso  infiltrar a plataforma da KILL COUNT, extrair o mximo de prisioneiros possvel e chegar ao objetivo.'}, 
