		{'identifier': 'mb_fob_event_info_04', 'language': 'jp', 'text': 'PFNO ALERT\nPFKILL COUNT\nKILL COUNT\n\n'}, 
		{'identifier': 'mb_fob_event_info_04', 'language': 'en', 'text': 'Under contract from the embattled up-and-coming PF "NO ALERT," we are to mount an assault against "KILL COUNT," a PF whose hardline business policies have seen them chew through countless mercenaries and worsen the violence in conflict regions, all while filling their own pockets. \nThe mission objective is to liberate local soldiers who are being oppressed by the KILL COUNT upper echelons. \nInfiltrate the enemy platform and reach the goal point, extracting or eliminating as many enemy soldiers as possible along the way.'}, 
		{'identifier': 'mb_fob_event_info_04', 'language': 'fr', 'text': "Sous contrat avec la prometteuse SMP assige  NO ALERT , on doit prparer un assaut contre  KILL COUNT , une SMP dont la politique agressive a cras bon nombre de mercenaires et amplifi la violence dans les zones de conflit, tout a pendant qu'ils s'en mettaient plein les poches. \nL'objectif de la mission est de librer les soldats locaux opprims par les responsables de KILL COUNT. \nInfiltre la plateforme ennemie et rejoins le point fix en extrayant ou en liminant autant de soldats ennemis que possible en chemin."}, 
		{'identifier': 'mb_fob_event_info_04', 'language': 'it', 'text': 'L\'emergente FP "NO ALERT" ci ha ingaggiato per assaltare la "KILL COUNT", una FP la cui politica inflessibile sta eliminando tantissimi validi mercenari, inasprendo la violenza nelle zone di guerra, il tutto solo per riempirsi le tasche.\nL\'obiettivo della missione  liberare i soldati locali oppressi dalle alte sfere della KILL COUNT.\nInfiltrati nella piattaforma nemica e raggiungi il punto stabilito, recuperando o eliminando il maggior numero di soldati nemici possibile.'}, 
		{'identifier': 'mb_fob_event_info_04', 'language': 'de', 'text': 'Im Auftrag des umkmpften und aufstrebenden MUs NO ALERT sollen wir einen Angriff auf KILL COUNT starten. Dieses MU hat durch sein hartes Vorgehen zahlreiche Sldner gettet und die Gewalt in mehreren Konfliktregionen angefacht, um sich die eigenen Taschen zu fllen. \nUnsere Mission: Soldaten vor Ort befreien, die von den oberen KILL COUNT-Rngen unterdrckt werden. \nInfiltrieren Sie die feindliche Plattform und erreichen Sie den Zielpunkt. Holen Sie dabei so viele feindliche Soldaten wie mglich raus oder eliminieren Sie sie.'}, 
		{'identifier': 'mb_fob_event_info_04', 'language': 'es', 'text': 'Segn el contrato de la asediada y prometedora FP "NO ALERT", debemos armar un asalto contra "KILL COUNT", una FP cuyas duras polticas de negocios la han hecho rebuscar entre incontables mercenarios y agravar la violencia en regiones de conflicto, todo esto mientras se llena los bolsillos.\nEl objetivo de la misin es liberar a los soldados locales que estn siendo oprimidos por los peldaos superiores de KILL COUNT.\nInfiltra la plataforma enemiga y alcanza el punto meta, extrayendo o eliminando a cuantos soldados enemigos puedas en tu avance.'}, 
		{'identifier': 'mb_fob_event_info_04', 'language': 'pt', 'text': 'Contratados pela FP em ascenso "NO ALERT", que est preparada para o combate, devemos efetuar um ataque contra a "KILL COUNT", uma FP cuja poltica de negcios linha-dura permitiu que eliminassem inmeros mercenrios, agravando a violncia nas regies de conflito, tudo isso enquanto enchiam seus prprios bolsos. \nO objetivo da misso  libertar os soldados locais que esto sendo oprimidos pelo alto escalo da KILL COUNT. \nInfiltrar na plataforma inimiga e avanar at o objetivo, extraindo ou eliminando o mximo de soldados inimigos pelo caminho.'}, 
