		{'identifier': 'mb_fob_event_info_05', 'language': 'jp', 'text': 'PFNO ALERTFOB\nNO ALERTPF\nFOBNO ALERT\nFOB4'}, 
		{'identifier': 'mb_fob_event_info_05', 'language': 'en', 'text': 'An FOB belonging to rookie PF "NO ALERT" has suddenly come under attack by remnants of the Skulls. We believe some other PF with a grudge against NO ALERT has sent in captured Skulls as bio-weapons.\nThe men staffing the FOB have been turned to puppet soldiers, bringing a halt to the FOB\'s functions. NO ALERT has offered us an emergency contract to resolve the problem.\nYour mission objective is to eliminate the 4 Skulls occupying the FOB.'}, 
		{'identifier': 'mb_fob_event_info_05', 'language': 'fr', 'text': 'Une FOB appartenant  une SMP dbutante, "NO ALERT" a t attaque par surprise par des Skulls survivants. Nous pensons qu\'une autre SMP ayant un compte  rgler avec NO ALERT a envoy des Skulls capturs comme armes biologiques.\nLe personnel de la FOB a t transform en marionnettes et la FOB a cess d\'tre oprationnelle. NO ALERTE nous propose un contrat en urgence pour rsoudre leur problme.\nL\'objectif de votre mission est d\'liminer les 4 Skulls qui occupent la FOB.'}, 
		{'identifier': 'mb_fob_event_info_05', 'language': 'it', 'text': 'Una FOB appartenente all\'emergente FP "NO ALERT"  stata attaccata improvvisamente da alcuni membri rimasti dei Teschi. Crediamo che una qualche altra FP abbia usato i Teschi come arma biologica per vendicarsi della NO ALERT.\nGli uomini di stanza sulla FOB sono stati trasformati in soldati fantoccio, bloccando di fatto il funzionamento della FOB. La NO ALERT ci ha offerto un contratto di emergenza per risolvere il problema.\nIl tuo obiettivo  eliminare i 4 Teschi che stanno occupando la FOB. '}, 
		{'identifier': 'mb_fob_event_info_05', 'language': 'de', 'text': 'Eine zum erst krzlich ins Geschft eingestiegenen MU "NO ALERT" gehrende FOB wurde pltzlich von restlichen Mitgliedern der Schdel angegriffen. Wir gehen davon aus, dass ein anderes MU, das einen Groll gegen NO ALERT hegt, gefangene Schdel als Biowaffen einsetzt.\nDas Personal auf der FOB wurde in Marionettensoldaten verwandelt, und der Betrieb der FOB kann nicht mehr fortgefhrt werden. NO ALERT hat uns einen Notfallvertrag angeboten, um das Problem zu lsen.\nIhr Missionsziel besteht darin, die vier Schdel zu eliminieren, von denen die FOB besetzt wurde.'}, 
		{'identifier': 'mb_fob_event_info_05', 'language': 'es', 'text': 'Una POA de una FP novata "SIN ALERTA" ha sido atacada repentinamente por restos de los Skull. Creemos que otra FP con resentimientos hacia una SIN ALERTA envo Skulls capturados como armas biolgicas.\nLos miembros de la POA se convirtieron en soldados marioneta, lo que detiene el funcionamiento de la POA. SIN ALERTA nos ha ofrecido un contrato de emergencia para resolver el problema.\nEl objetivo de tu misin es eliminar a los 4 Skulls que ocupan la POA.'}, 
		{'identifier': 'mb_fob_event_info_05', 'language': 'pt', 'text': 'A Base Externa de uma FP iniciante, a "SEM ALERTA", foi atacada de repente por remanescentes dos Caveiras. Acreditamos que alguma outra FP com rancor contra o SEM ALERTA enviou Caveiras capturados como armas biolgicas.\nOs homens posicionados na Base Externa foram transformados em soldados-marionete, freando as funes da Base Externa. A SEM ALERTA nos ofereceu um contrato de emergncia para resolver o problema.\nO objetivo da sua misso  eliminar os quatro Caveiras que ocupam a Base Externa.'}, 
